import React , {Component} from 'react';
import axios from 'axios';
import 'bootstrap/dist/css/bootstrap.min.css';

import './App.css';

class App extends Component {
  state ={ region:[]}
componentDidMount(){
  axios
  .get("http://127.0.0.1:8000/api/welcome")
  .then((response) =>{
    console.log(response);
    this.setState({region: response.data})
})
.catch((error) =>{
  console.log(error);
});
}
  render(){  
  return (
   <div className="App">
     <div className="form-group">
<select name="region" className="form-control">
  {this.state.region.map(elemento=>(

    <option key={elemento.id} value={elemento.id}>{elemento.id}</option>
  ))}
</select>

     </div>
   </div>
  );
}
}


export default App;
